//Credit: https://kyrise.itch.io/kyrises-free-16x16-rpg-icon-pack
import HpPotionImg from './hp-potion.png';

const HpPotion = {
    name: 'Health Potion',
    type: 'potion',
    kind: 'health',
    hp: 20,
    hpReset: 20,
    image: HpPotionImg,
    value: 40,
};

export default HpPotion;
